import './Chart.css';
import ChartBar from './ChartBar';

const Chart = (props)=>{

    return (
        <div className='chart'>
            {props.dataPoints.map((dataPoint)=>{
             return(<ChartBar value={dataPoint.value} maxValue={props.maxValue} label={dataPoint.label}></ChartBar>)
            }
            )}
        </div>
    )
};

export default Chart;
